import { title } from "assets/jss/material-kit-react.js";

const workStyle = {
  section: {
    textAlign: "center"
  },
  title: {
    ...title,

    minHeight: "32px",
    textDecoration: "none",
    textAlign: "center"
  },
  description: {
    color: "#999",
    textAlign: "center"
  },
  textCenter: {
    textAlign: "center"
  },
  textArea: {
    marginRight: "15px",
    marginLeft: "15px"
  }
};

export default workStyle;
